export const fetchMapInfo = function (props){
  let id = props.match.params.id
  fetch(`/maps/${id}`,
    { accept: 'application/json',})
    .then(res => res.json())
    .then(json => json)
}

export const fetchPins = function (props){
  let id = props.match.params.id
  fetch(`/maps/${id}/pins`,
    { accept: 'application/json',})
    .then(res => res.json())
    .then(json => json)
}


